import React, { Component } from 'react';
import 'ol/ol.css';
import './Map.css';
import Map from 'ol/Map.js';
import View from 'ol/View.js';
import { Style, Icon, Stroke } from 'ol/style.js';
import { Tile as TileLayer, Vector as VectorLayer } from 'ol/layer.js';
import OSM from 'ol/source/OSM.js';
import VectorSource from 'ol/source/Vector.js';
import Feature from 'ol/Feature.js';
import { fromLonLat } from 'ol/proj.js';
import Point from 'ol/geom/Point.js';
import LineString from 'ol/geom/LineString.js';
import airplaneimg from './614.png';

class MapComponent extends Component {
  constructor(props) {
    super(props);
    this.mapRef = React.createRef();
    this.map = null;
    this.airplanesSource = null;
    this.tileLayer = null;
    this.airplanesLayer = null;
    this.airplaneIcon = null;
    this.bboxRef = React.createRef();
    this.flightPathSource = null;
    this.flightPathLayer = null;
  }

  componentDidMount() {
    this.initializeMap();
  }

  initializeMap() {
    this.tileLayer = new TileLayer({
      source: new OSM(),
    });

    this.map = new Map({
      layers: [this.tileLayer],
      target: this.mapRef.current,
      view: new View({
        center: [-11000000, 4600000],
        zoom: 2,
      }),
    });

    this.airplaneIcon = new Icon({
      src: airplaneimg,
      scale: 0.05,
    });

    this.airplanesSource = new VectorSource();
    this.airplanesLayer = new VectorLayer({
      source: this.airplanesSource,
      style: new Style({
        image: this.airplaneIcon,
      }),
    });

    this.flightPathSource = new VectorSource();
    this.flightPathLayer = new VectorLayer({
      source: this.flightPathSource,
      style: new Style({
        stroke: new Stroke({
          color: 'red',
          width: 2,
        }),
      }),
    });

    this.map.addLayer(this.airplanesLayer);
    this.map.addLayer(this.flightPathLayer);
  }

  fetchAircraftData(bbox) {
    const [lonMin, latMin, lonMax, latMax] = bbox.split(',');
    const url = `https://opensky-network.org/api/states/all?lamin=${latMin}&lomin=${lonMin}&lamax=${latMax}&lomax=${lonMax}`;

    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        const aircrafts = data.states;
        this.addAircraftsToMap(aircrafts);
        this.addFlightPaths(aircrafts);
        this.fitMapToAircrafts();

        // Convert aircraft data to JSON
        const aircraftsJSON = JSON.stringify(aircrafts);
        console.log(aircraftsJSON);

        // Print longitude and latitude
        aircrafts.forEach((aircraft) => {
          const lon = aircraft[5];
          const lat = aircraft[6];
          console.log(`Longitude: ${lon}, Latitude: ${lat}`);
        });
      })
      .catch((error) => {
        console.error('Error fetching aircraft data:', error);
        console.error('URL:', url);
      });
  }

  addAircraftsToMap(aircrafts) {
    this.airplanesSource.clear();

    aircrafts.forEach((aircraft) => {
      const lon = aircraft[5];
      const lat = aircraft[6];

      if (lon && lat) {
        const coordinates = fromLonLat([lon, lat]);
        const feature = new Feature({
          geometry: new Point(coordinates),
        });

        feature.setStyle(new Style({
          image: this.airplaneIcon,
        }));

        this.airplanesSource.addFeature(feature);
      }
    });
  }

  addFlightPaths(aircrafts) {
    this.flightPathSource.clear();

    aircrafts.forEach((aircraft) => {
      const lon = aircraft[5];
      const lat = aircraft[6];
      const track = aircraft[10];

      if (lon && lat && track) {
        const coordinates = fromLonLat([lon, lat]);
        const path = new LineString([coordinates, fromLonLat([lon + track, lat])]);

        const feature = new Feature({
          geometry: path,
        });

        this.flightPathSource.addFeature(feature);
      }
    });
  }

  fitMapToAircrafts() {
    const extent = this.airplanesSource.getExtent();
    this.map.getView().fit(extent, { padding: [50, 50, 50, 50] });
  }

  handleShowAircrafts = () => {
    const bboxInput = this.bboxRef.current.value;
    const [lonMin, latMin, lonMax, latMax] = bboxInput.split(',');

    if (lonMin && latMin && lonMax && latMax) {
      const formattedBbox = `${parseFloat(lonMin)},${parseFloat(latMin)},${parseFloat(lonMax)},${parseFloat(latMax)}`;
      this.fetchAircraftData(formattedBbox);
    }
  };

  render() {
    return (
      <div>
        <div>
          <input ref={this.bboxRef} type="text" placeholder="Input bbox (lonmin,latmin,lonmax,latmax)" />
          <button onClick={this.handleShowAircrafts}>Show Aircrafts</button>
        </div>
        <div ref={this.mapRef} className="map-container" />
      </div>
    );
  }
}

export default MapComponent;
